INSERT INTO `T_SERVICE_PRODUCT` VALUES ('2c92b642662e966801664993d46c0032',NULL,'2c92b642662e9668016653a0b5e60039,2c92b642662e9668016653a08a810038,2c92b642662e9668016653a020440037,,,2c92b642662e9668016653a4394a003b,,,,,,,,,,,,2c92b642662e9668016653a205b2003a','2018-10-06 13:31:57','/images/20181006/1538832628063.jpg','推荐方案',230,NULL,NULL,'2c92b642662e9668016649101b060020'),('2c92b64266ccf4b30166e90691070032','\r\n\r\n退款\r\n\r\n套餐内按照使用次数计算服务费，剩余的金额退回；\r\n\r\n提交退款申请，将会在3~7个工作日退回原支付账户；\r\n\r\n平台优惠券、红包不予退还；\r\n\r\n\r\n取消订单\r\n\r\n预约成功后由于您个人原因取消订单，将收取30%的服务费；\r\n\r\n如需修改预约请提前4小时通知护士，护士出发后取消订单，将收取70%的服务费。\r\n\r\n\r\n注意事项\r\n\r\n受限于客观条件，具有攻击性、易产生过激反应的患者不在服务范围以内；\r\n\r\n保持创伤部位清洁干燥,请勿沾水；尽量减少创伤部位的活动,以免出现渗血等现象；\r\n\r\n伤口严重感染或坏死、大量活动性岀血者不提供上门换药服务。\r\n\r\n护理项目需要家属陪同，如家属无法陪同请谨慎使用此护理服务；\r\n\r\n护理工具：\r\n\r\n伤口换药耗材包（15元）\r\n\r\n种类：                          规格/数量\r\n\r\n一次性换药包                     通用 1\r\n\r\n无菌手套                          中号1\r\n\r\n医用纱布块                       通用  若干\r\n\r\n无菌棉签                         通用    若干\r\n\r\n医用胶布                         通用   适量\r\n\r\n\r\n注：耗材具体费用根据医疗机构标准定价收取。\r\n\r\n如我们提供的服务耗材包无您所需耗材，请备注或者在医护回访中说明。\r\n\r\n\r\n疾病选择\r\n\r\n无\r\n\r\n术后\r\n\r\n外伤\r\n\r\n破损性疾病\r\n',NULL,'2018-11-06 12:36:54','/images/20181106/1541508523255.jpg','住院探视护理',169,NULL,'\r\n\r\n用户需提供换药部位的情况或者病历证明；\r\n\r\n护士只提供换药技术服务，相关医疗耗材需用户自备；\r\n\r\n护士上门一次可为同一患者提供三个部位的换药服务，每个部位换药面积不超过10*10cm。超出规定范围，按照30元/3个部位额外收取费用。\r\n\r\n本次服务时长为30分钟，超出时长按照20分钟一个单位加收40元。\r\n\r\n伤口严重感染或坏死、大量活动性岀血者不提供上门换药服务。\r\n\r\n本服务由「护理易」提供，专家团队全程支持，咨询电话：400-0000601.\r\n\r\n平台优势\r\n\r\n（执业护士专业服务）（全程投保安全放心）（专家团队随时售后）\r\n','2c92b642662e966801664912026f0022'),('2c92b64266ccf4b30166e9072dbf0033','\r\n\r\n退款\r\n\r\n套餐内按照使用次数计算服务费，剩余的金额退回；\r\n\r\n提交退款申请，将会在3~7个工作日退回原支付账户；\r\n\r\n平台优惠券、红包不予退还；\r\n\r\n\r\n取消订单\r\n\r\n预约成功后由于您个人原因取消订单，将收取30%的服务费；\r\n\r\n如需修改预约请提前4小时通知护士，护士出发后取消订单，将收取70%的服务费。\r\n\r\n\r\n注意事项\r\n\r\n受限于客观条件，具有攻击性、易产生过激反应的患者不在服务范围以内；\r\n\r\n保持创伤部位清洁干燥,请勿沾水；尽量减少创伤部位的活动,以免出现渗血等现象；\r\n\r\n伤口严重感染或坏死、大量活动性岀血者不提供上门